import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 23.1-2101 Membership.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-2101.md","filePath":"vacode/23.1-2101.md"}'),o={name:"vacode/23.1-2101.md"},i=r('<h1 id="§-23-1-2101-membership" tabindex="-1">§ 23.1-2101 Membership. <a class="header-anchor" href="#§-23-1-2101-membership" aria-label="Permalink to &quot;§ 23.1-2101 Membership.&quot;">​</a></h1><p>A. The board shall consist of 15 members appointed by the Governor, of whom at least 11 shall be residents of the Commonwealth.</p><p>B. The alumni association of the University may submit to the Governor a list of at least three nominees for each vacancy on the board, whether the vacancy occurs by expiration of a term or otherwise. The Governor may appoint a member from the list of nominees.</p><p>1964, c. 50, §§ 23-155.4, 23-155.5; 1976, c. 25; 2007, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0471" target="_blank" rel="noreferrer">471</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0727" target="_blank" rel="noreferrer">727</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),n=[i];function s(c,h,l,p,m,_){return a(),t("div",null,n)}const b=e(o,[["render",s]]);export{d as __pageData,b as default};
